DROP TABLE IF EXISTS `cdisease`;
CREATE TABLE `cdisease` (
  `diseasecode` char(7) NOT NULL DEFAULT '',
  `disease` varchar(255) DEFAULT NULL,
  `diseasethai` varchar(255) DEFAULT NULL,
  `code504` varchar(2) DEFAULT NULL COMMENT 'รหัสกลุ่มโรค 504',
  `code506` varchar(2) DEFAULT NULL COMMENT 'รหัสกลุ่มโรคระบาดวิทยา 506',
  `codechronic` varchar(4) DEFAULT NULL COMMENT 'รหัสกลุ่มโรคเรื้อรัง NCD',
  `diagcode` varchar(7) DEFAULT NULL COMMENT 'รหัส icd-10 ไม่มีจุด',
  `code298` varchar(5) DEFAULT NULL COMMENT 'รหัสกลุ่มโรค298กลุ่มโรค',
  `code505` varchar(2) DEFAULT NULL COMMENT 'รหัสกลุ่มโรค505 (ผู้ป่วยใน)',
  `codemental` varchar(2) DEFAULT NULL COMMENT 'รหัสกลุ่มโรคจิต',
  `codedental` varchar(2) DEFAULT NULL COMMENT 'รหัสกลุ่มโรคฟัน',
  `code19` varchar(2) DEFAULT NULL COMMENT 'กลุ่มโรคอุบัติเหตุ 19 สาเหตุ',
  `codeca` varchar(2) DEFAULT '',
  PRIMARY KEY (`diseasecode`),
  KEY `idx_504` (`diseasecode`,`code504`),
  KEY `idx_506` (`diseasecode`,`code506`) USING BTREE,
  KEY `idx1` (`diagcode`) USING BTREE
